import React, { PureComponent } from 'react';
import {ResponsiveContainer, BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend,} from 'recharts';
import './Graph2.css';

const DataFormater = (number) => {
    if(number > 1000000000){
      return (number/1000000000).toString() + 'B';
    }else if(number > 1000000){
      return (number/1000000).toString() + 'M';
    }else if(number > 1000){
      return (number/1000).toString() + 'K';
    }else{
      return number.toString();
    }
}

const data = [
  {
    name: 'Gr2A', uv: 14, pv: 7, amt: 2400,
  },
  {
    name: 'Gr2B', uv: 10, pv: 9, amt: 2210,
  },
  {
    name: 'Gr4A', uv: 17, pv: 4, amt: 2290,
  },
  {
    name: 'Gr4B', uv: 5, pv: 14, amt: 2290,
  },
];


export default class Example extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/alidingling/q4eonc12/';

  render() {
    return (
      <div className="widgetGraph2">
        <h5>Class Data</h5>
            <ResponsiveContainer width="95%" height={350}>
              <BarChart width={500} height={300} data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5,}}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="name" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Bar dataKey="pv" stackId="a" fill="#8884d8" />
                  <Bar dataKey="uv" stackId="a" fill="#82ca9d" />
              </BarChart>
          </ResponsiveContainer>
    </div>
    );
  }
}
